static char __pyx_k_83[] = "Return a copy of the array collapsed into one dimension.\n\n        Parameters\n        ----------\n        order : {'C', 'F'}, optional\n            Whether to flatten in C (row-major) or Fortran (column-major) order.\n            The default is 'C'.\n\n        Returns\n        -------\n        y : ndarray\n            A copy of the input array, flattened to one dimension.\n\n        See Also\n        --------\n        ravel : Return a flattened array.\n        flat : A 1-D flat iterator over the array.\n\n        Examples\n        --------\n        >>> a = np.array([[1,2], [3,4]])\n        >>> a.flatten()\n        array([1, 2, 3, 4])\n        >>> a.flatten('F')\n        array([1, 3, 2, 4])\n\n        ";
static char __pyx_k_84[] = "ndarray.getfield (line 830)";
static char __pyx_k_85[] = "Returns a field of the given array as a certain type.\n\n        A field is a view of the array data with each itemsize determined\n        by the given type and the offset into the current array, i.e. from\n        ``offset * dtype.itemsize`` to ``(offset+1) * dtype.itemsize``.\n\n        Parameters\n        ----------\n        dtype : str\n            String denoting the data type of the field.\n        offset : int\n            Number of `dtype.itemsize`'s to skip before beginning the element view.\n\n        Examples\n        --------\n        >>> x = np.diag([1.+1.j]*2)\n        >>> x\n        array([[ 1.+1.j,  0.+0.j],\n               [ 0.+0.j,  1.+1.j]])\n        >>> x.dtype\n        dtype('complex128')\n\n        >>> x.getfield('complex64', 0) # Note how this != x\n        array([[ 0.+1.875j,  0.+0.j   ],\n               [ 0.+0.j   ,  0.+1.875j]], dtype=complex64)\n\n        >>> x.getfield('complex64',1) # Note how different this is than x\n        array([[ 0. +5.87173204e-39j,  0. +0.00000000e+00j],\n               [ 0. +0.00000000e+00j,  0. +5.87173204e-39j]], dtype=complex64)\n\n        >>> x.getfield('complex128', 0) # == x\n        array([[ 1.+1.j,  0.+0.j],\n               [ 0.+0.j,  1.+1.j]])\n\n        If the argument dtype is the same as x.dtype, then offset != 0 raises\n        a ValueError:\n\n        >>> x.getfield('complex128', 1)\n        Traceback (most recent call last):\n          File \"<stdin>\", line 1, in <module>\n        ValueError: Need 0 <= offset <= 0 for requested type but received offset = 1\n\n        >>> x.getfield('float64', 0)\n        array([[ 1.,  0.],\n               [ 0.,  1.]])\n\n        >>> x.getfield('float64', 1)\n        array([[  1.77658241e-307,   0.00000000e+000],\n               [  0.00000000e+000,   1.77658241e-307]])\n\n        ";
static char __pyx_k_86[] = "ndarray.item (line 884)";
static char __pyx_k_87[] = "Copy an element of an array to a standard Python scalar and return it.\n\n        Parameters\n        ----------\n        \\*args : Arguments (variable number and type)\n\n            * none: in this case, the method only works for arrays\n              with one element (`a.size == 1`), which element is\n              copied into a standard Python scalar object and returned.\n\n            * int_type: this argument is interpreted as a flat index into\n              the array, specifying which element to copy and return.\n\n            * tuple of int_types: functions as does a single int_type argument,\n              except that the argument is interpreted as an nd-index into the\n              array.\n\n        Returns\n        -------\n        z : Standard Python scalar object\n            A copy of the specified element of the array as a suitable\n            Python scalar\n\n        Notes\n        -----\n        When the data type of `a` is longdouble or clongdouble, item() returns\n        a scalar array object because there is no available Python scalar that\n        would not lose information. Void arrays return a buffer object for item(),\n        unless fields are defined, in which case a tuple is returned.\n\n        `item` is very similar to a[args], except, instead of an array scalar,\n        a standard Python scalar is returned. This can be useful for speeding up\n        access to elements of the array and doing arithmetic on elements of the\n        array using Python's optimized math.\n\n        Examples\n        --------\n        >>> x = np.random.randint(9, size=(3, 3))\n        >>> x\n        array([[3, 1, 7],\n               [2, 8, 3],\n               [8, 5, 3]])\n        >>> x.item(3)\n        2\n        >>> x.item(7)\n        5\n        >>> x.item((0, 1))\n        1\n        >>> x.item((2, 2))\n        3\n\n        ";
static char __pyx_k_88[] = "ndarray.itemset (line 939)";
static char __pyx_k_89[] = "Insert scalar into an array (scalar is cast to array's dtype, if possible)\n\n        There must be at least 1 argument, and define the last argument\n        as *item*.  Then, ``a.itemset(*args)`` is equivalent to but faster\n        than ``a[args] = item``.  The item should be a scalar value and `args`\n        must select a single item in the array `a`.\n\n        Parameters\n        ----------\n        \\*args : Arguments\n            If one argument: a scalar, only used in case `a` is of size 1.\n            If two arguments: the last argument is the value to be set\n            and must be a scalar, the first argument specifies a single array\n            element location. It is either an int or a tuple.\n\n        Notes\n        -----\n        Compared to indexing syntax, `itemset` provides some speed increase\n        for placing a scalar into a particular location in an `ndarray`,\n        if you must do this.  However, generally this is discouraged:\n        among other problems, it complicates the appearance of the code.\n        Also, when using `itemset` (and `item`) inside a loop, be sure\n        to assign the methods to a local variable to avoid the attribute\n        look-up at each loop iteration.\n\n        Examples\n        --------\n        >>> x = np.random.randint(9, size=(3, 3))\n        >>> x\n        array([[3, 1, 7],\n               [2, 8, 3],\n               [8, 5, 3]])\n        >>> x.itemset(4, 0)\n        >>> x.itemset((2, 2), 9)\n        >>> x\n        array([[3, 1, 7],\n               [2, 0, 3],\n               [8, 5, 9]])\n\n        ";
static char __pyx_k_90[] = "ndarray.resize (line 1143)";
static char __pyx_k_91[] = "Change shape and size of array in-place.\n\n        Parameters\n        ----------\n        new_shape : tuple of ints, or `n` ints\n            Shape of resized array.\n        refcheck : bool, optional\n            If False, reference count will not be checked. Default is True.\n\n        Returns\n        -------\n        None\n\n        Raises\n        ------\n        ValueError\n            If `a` does not own its own data or references or views to it exist,\n            and the data memory must be changed.\n\n        SystemError\n            If the `order` keyword argument is specified. This behaviour is a\n            bug in NumPy.\n\n        See Also\n        --------\n        resize : Return a new array with the specified shape.\n\n        Notes\n        -----\n        This reallocates space for the data area if necessary.\n\n        Only contiguous arrays (data elements consecutive in memory) can be\n        resized.\n\n        The purpose of the reference count check is to make sure you\n        do not use this array as a buffer for another Python object and then\n        reallocate the memory. However, reference counts can increase in\n        other ways so if you are sure that you have not shared the memory\n        for this array with another Python object, then you may safely set\n        `refcheck` to False.\n\n        Examples\n        --------\n        Shrinking an array: array is flattened (in the order that the data are\n        stored in memory), resized, and reshaped:\n\n        >>> a = np.array([[0, 1], [2, 3]], order='C')\n        >>> a.resize((2, 1))\n        >>> a\n        array([[0],\n               [1]])\n\n        >>> a = np.array([[0, 1], [2, 3]], order='F')\n        >>> a.resize((2, 1))\n        >>> a\n        array([[0],\n               [2]])\n\n        Enlarging an array: as above, but missing entries are filled with zeros:\n\n        >>> b = np.array([[0, 1], [2, 3]])\n        >>> b.resize(2, 3) # new_shape parameter doesn't have to b""e a tuple\n        >>> b\n        array([[0, 1, 2],\n               [3, 0, 0]])\n\n        Referencing an array prevents resizing...\n\n        >>> c = a\n        >>> a.resize((1, 1))\n        Traceback (most recent call last):\n        ...\n        ValueError: cannot resize an array that has been referenced ...\n\n        Unless `refcheck` is False:\n\n        >>> a.resize((1, 1), refcheck=False)\n        >>> a\n        array([[0]])\n        >>> c\n        array([[0]])\n\n        ";
static char __pyx_k_92[] = "ndarray.setfield (line 1253)";
static char __pyx_k_93[] = "Put a value into a specified place in a field defined by a data-type.\n\n        Place `val` into `a`'s field defined by `dtype` and beginning `offset`\n        bytes into the field.\n\n        Parameters\n        ----------\n        val : object\n            Value to be placed in field.\n        dtype : dtype object\n            Data-type of the field in which to place `val`.\n        offset : int, optional\n            The number of bytes into the field at which to place `val`.\n\n        Returns\n        -------\n        None\n\n        See Also\n        --------\n        getfield\n\n        Examples\n        --------\n        >>> x = np.eye(3)\n        >>> x.getfield(np.float64)\n        array([[ 1.,  0.,  0.],\n               [ 0.,  1.,  0.],\n               [ 0.,  0.,  1.]])\n        >>> x.setfield(3, np.int32)\n        >>> x.getfield(np.int32)\n        array([[3, 3, 3],\n               [3, 3, 3],\n               [3, 3, 3]])\n        >>> x\n        array([[  1.00000000e+000,   1.48219694e-323,   1.48219694e-323],\n               [  1.48219694e-323,   1.00000000e+000,   1.48219694e-323],\n               [  1.48219694e-323,   1.48219694e-323,   1.00000000e+000]])\n        >>> x.setfield(np.eye(3), np.int32)\n        >>> x\n        array([[ 1.,  0.,  0.],\n               [ 0.,  1.,  0.],\n               [ 0.,  0.,  1.]])\n\n        ";
static char __pyx_k_94[] = "ndarray.setflags (line 1301)";
static char __pyx_k_95[] = "Set array flags WRITEABLE, ALIGNED, and UPDATEIFCOPY, respectively.\n\n        These Boolean-valued flags affect how numpy interprets the memory\n        area used by `a` (see Notes below). The ALIGNED flag can only\n        be set to True if the data is actually aligned according to the type.\n        The UPDATEIFCOPY flag can never be set to True. The flag WRITEABLE\n        can only be set to True if the array owns its own memory, or the\n        ultimate owner of the memory exposes a writeable buffer interface,\n        or is a string. (The exception for string is made so that unpickling\n        can be done without copying memory.)\n\n        Parameters\n        ----------\n        write : bool, optional\n            Describes whether or not `a` can be written to.\n        align : bool, optional\n            Describes whether or not `a` is aligned properly for its type.\n        uic : bool, optional\n            Describes whether or not `a` is a copy of another \"base\" array.\n\n        Notes\n        -----\n        Array flags provide information about how the memory area used\n        for the array is to be interpreted. There are 6 Boolean flags\n        in use, only three of which can be changed by the user:\n        UPDATEIFCOPY, WRITEABLE, and ALIGNED.\n\n        WRITEABLE (W) the data area can be written to;\n\n        ALIGNED (A) the data and strides are aligned appropriately for the hardware\n        (as determined by the compiler);\n\n        UPDATEIFCOPY (U) this array is a copy of some other array (referenced\n        by .base). When this array is deallocated, the base array will be\n        updated with the contents of this array.\n\n        All flags can be accessed using their first (upper case) letter as well\n        as the full name.\n\n        Examples\n        --------\n        >>> y\n        array([[3, 1, 7],\n               [2, 0, 0],\n               [8, 5, 9]])\n        >>> y.flags\n          C_CONTIGUOUS : True\n          F_CONTIGUOUS : ""False\n          OWNDATA : True\n          WRITEABLE : True\n          ALIGNED : True\n          UPDATEIFCOPY : False\n        >>> y.setflags(write=0, align=0)\n        >>> y.flags\n          C_CONTIGUOUS : True\n          F_CONTIGUOUS : False\n          OWNDATA : True\n          WRITEABLE : False\n          ALIGNED : False\n          UPDATEIFCOPY : False\n        >>> y.setflags(uic=1)\n        Traceback (most recent call last):\n          File \"<stdin>\", line 1, in <module>\n        ValueError: cannot set UPDATEIFCOPY flag to True\n\n        ";
static char __pyx_k_96[] = "ndarray.sort (line 1370)";
static char __pyx_k_97[] = "Sort an array, in-place.\n\n        Parameters\n        ----------\n        axis : int, optional\n            Axis along which to sort. Default is -1, which means sort along the\n            last axis.\n        kind : {'quicksort', 'mergesort', 'heapsort'}, optional\n            Sorting algorithm. Default is 'quicksort'.\n        order : list, optional\n            When `a` is an array with fields defined, this argument specifies\n            which fields to compare first, second, etc.  Not all fields need be\n            specified.\n\n        See Also\n        --------\n        numpy.sort : Return a sorted copy of an array.\n        argsort : Indirect sort.\n        lexsort : Indirect stable sort on multiple keys.\n        searchsorted : Find elements in sorted array.\n\n        Notes\n        -----\n        See ``sort`` for notes on the different sorting algorithms.\n\n        Examples\n        --------\n        >>> a = np.array([[1,4], [3,1]])\n        >>> a.sort(axis=1)\n        >>> a\n        array([[1, 4],\n               [1, 3]])\n        >>> a.sort(axis=0)\n        >>> a\n        array([[1, 3],\n               [1, 4]])\n\n        Use the `order` keyword to specify a field to use when sorting a\n        structured array:\n\n        >>> a = np.array([('a', 2), ('c', 1)], dtype=[('x', 'S1'), ('y', int)])\n        >>> a.sort(order='y')\n        >>> a\n        array([('c', 1), ('a', 2)],\n              dtype=[('x', '|S1'), ('y', '<i4')])\n\n        ";
static char __pyx_k_98[] = "ndarray.tolist (line 1521)";
static char __pyx_k_99[] = "Return the array as a (possibly nested) list.\n\n        Return a copy of the array data as a (nested) Python list.\n        Data items are converted to the nearest compatible Python type.\n\n        Parameters\n        ----------\n        none\n\n        Returns\n        -------\n        y : list\n            The possibly nested list of array elements.\n\n        Notes\n        -----\n        The array may be recreated, ``a = np.array(a.tolist())``.\n\n        Examples\n        --------\n        >>> a = np.array([1, 2])\n        >>> a.tolist()\n        [1, 2]\n        >>> a = np.array([[1, 2], [3, 4]])\n        >>> list(a)\n        [array([1, 2]), array([3, 4])]\n        >>> a.tolist()\n        [[1, 2], [3, 4]]\n\n        ";
