static char __pyx_k_100[] = "ndarray.tostring (line 1554)";
static char __pyx_k_101[] = "Construct a Python string containing the raw data bytes in the array.\n\n        Constructs a Python string showing a copy of the raw contents of\n        data memory. The string can be produced in either 'C' or 'Fortran',\n        or 'Any' order (the default is 'C'-order). 'Any' order means C-order\n        unless the F_CONTIGUOUS flag in the array is set, in which case it\n        means 'Fortran' order.\n\n        Parameters\n        ----------\n        order : {'C', 'F', None}, optional\n            Order of the data for multidimensional arrays:\n            C, Fortran, or the same as for the original array.\n\n        Returns\n        -------\n        s : str\n            A Python string exhibiting a copy of `a`'s raw data.\n\n        Examples\n        --------\n        >>> x = np.array([[0, 1], [2, 3]])\n        >>> x.tostring()\n        '\000\000\000\000\001\000\000\000\002\000\000\000\003\000\000\000'\n        >>> x.tostring('C') == x.tostring()\n        True\n        >>> x.tostring('F')\n        '\000\000\000\000\002\000\000\000\001\000\000\000\003\000\000\000'\n\n        ";
static char __pyx_k_102[] = "ndarray.transpose (line 1599)";
static char __pyx_k_103[] = "Returns a view of the array with axes transposed.\n\n        For a 1-D array, this has no effect. (To change between column and\n        row vectors, first cast the 1-D array into a matrix object.)\n        For a 2-D array, this is the usual matrix transpose.\n        For an n-D array, if axes are given, their order indicates how the\n        axes are permuted (see Examples). If axes are not provided and\n        ``a.shape = (i[0], i[1], ... i[n-2], i[n-1])``, then\n        ``a.transpose().shape = (i[n-1], i[n-2], ... i[1], i[0])``.\n\n        Parameters\n        ----------\n        axes : None, tuple of ints, or `n` ints\n\n         * None or no argument: reverses the order of the axes.\n\n         * tuple of ints: `i` in the `j`-th place in the tuple means `a`'s\n           `i`-th axis becomes `a.transpose()`'s `j`-th axis.\n\n         * `n` ints: same as an n-tuple of the same ints (this form is\n           intended simply as a \"convenience\" alternative to the tuple form)\n\n        Returns\n        -------\n        out : ndarray\n            View of `a`, with axes suitably permuted.\n\n        See Also\n        --------\n        ndarray.T : Array property returning the array transposed.\n\n        Examples\n        --------\n        >>> a = np.array([[1, 2], [3, 4]])\n        >>> a\n        array([[1, 2],\n               [3, 4]])\n        >>> a.transpose()\n        array([[1, 3],\n               [2, 4]])\n        >>> a.transpose((1, 0))\n        array([[1, 3],\n               [2, 4]])\n        >>> a.transpose(1, 0)\n        array([[1, 3],\n               [2, 4]])\n\n        ";
static char __pyx_k_104[] = "ndarray.view (line 1662)";
static char __pyx_k_105[] = "New view of array with the same data.\n\n        Parameters\n        ----------\n        dtype : data-type, optional\n            Data-type descriptor of the returned view, e.g., float32 or int16.\n            The default, None, results in the view having the same data-type\n            as `a`.\n        type : Python type, optional\n            Type of the returned view, e.g., ndarray or matrix.  Again, the\n            default None results in type preservation.\n\n        Notes\n        -----\n        ``a.view()`` is used two different ways:\n\n        ``a.view(some_dtype)`` or ``a.view(dtype=some_dtype)`` constructs a view\n        of the array's memory with a different data-type.  This can cause a\n        reinterpretation of the bytes of memory.\n\n        ``a.view(ndarray_subclass)`` or ``a.view(type=ndarray_subclass)`` just\n        returns an instance of `ndarray_subclass` that looks at the same array\n        (same shape, dtype, etc.)  This does not cause a reinterpretation of the\n        memory.\n\n\n        Examples\n        --------\n        >>> x = np.array([(1, 2)], dtype=[('a', np.int8), ('b', np.int8)])\n\n        Viewing array data using a different type and dtype:\n\n        >>> y = x.view(dtype=np.int16, type=np.matrix)\n        >>> y\n        matrix([[513]], dtype=int16)\n        >>> print type(y)\n        <class 'numpy.matrixlib.defmatrix.matrix'>\n\n        Creating a view on a structured array so it can be used in calculations\n\n        >>> x = np.array([(1, 2),(3,4)], dtype=[('a', np.int8), ('b', np.int8)])\n        >>> xv = x.view(dtype=np.int8).reshape(-1,2)\n        >>> xv\n        array([[1, 2],\n               [3, 4]], dtype=int8)\n        >>> xv.mean(0)\n        array([ 2.,  3.])\n\n        Making changes to the view changes the underlying array\n\n        >>> xv[0,1] = 20\n        >>> print x\n        [(1, 20) (3, 4)]\n\n        Using a view to convert an array to a record array:\n\n        >>> z = x.view(np.recarray)\n        >>> z.a""\n        array([1], dtype=int8)\n\n        Views share data:\n\n        >>> x[0] = (9, 10)\n        >>> z[0]\n        (9, 10)\n\n        ";
static char __pyx_k_106[] = "ufunc.reduce (line 2352)";
static char __pyx_k_107[] = "reduce(a, axis=0, dtype=None, out=None)\n\n    Reduces `a`'s dimension by one, by applying ufunc along one axis.\n\n    Let :math:`a.shape = (N_0, ..., N_i, ..., N_{M-1})`.  Then\n    :math:`ufunc.reduce(a, axis=i)[k_0, ..,k_{i-1}, k_{i+1}, .., k_{M-1}]` =\n    the result of iterating `j` over :math:`range(N_i)`, cumulatively applying\n    ufunc to each :math:`a[k_0, ..,k_{i-1}, j, k_{i+1}, .., k_{M-1}]`.\n    For a one-dimensional array, reduce produces results equivalent to:\n    ::\n\n     r = op.identity # op = ufunc\n     for i in xrange(len(A)):\n       r = op(r, A[i])\n     return r\n\n    For example, add.reduce() is equivalent to sum().\n\n    Parameters\n    ----------\n    a : array_like\n        The array to act on.\n    axis : int, optional\n        The axis along which to apply the reduction.\n    dtype : data-type code, optional\n        The type used to represent the intermediate results. Defaults\n        to the data-type of the output array if this is provided, or\n        the data-type of the input array if no output array is provided.\n    out : ndarray, optional\n        A location into which the result is stored. If not provided, a\n        freshly-allocated array is returned.\n\n    Returns\n    -------\n    r : ndarray\n        The reduced array. If `out` was supplied, `r` is a reference to it.\n\n    Examples\n    --------\n    >>> np.multiply.reduce([2,3,5])\n    30\n\n    A multi-dimensional array example:\n\n    >>> X = np.arange(8).reshape((2,2,2))\n    >>> X\n    array([[[0, 1],\n            [2, 3]],\n           [[4, 5],\n            [6, 7]]])\n    >>> np.add.reduce(X, 0)\n    array([[ 4,  6],\n           [ 8, 10]])\n    >>> np.add.reduce(X) # confirm: default axis value is 0\n    array([[ 4,  6],\n           [ 8, 10]])\n    >>> np.add.reduce(X, 1)\n    array([[ 2,  4],\n           [10, 12]])\n    >>> np.add.reduce(X, 2)\n    array([[ 1,  5],\n           [ 9, 13]])\n\n        ";
static char __pyx_k_108[] = "zeros (line 2606)";
static char __pyx_k_109[] = "zeros(shape, dtype=float, order='C')\n\n    Return a new array of given shape and type, filled with zeros.\n\n    Parameters\n    ----------\n    shape : int or sequence of ints\n        Shape of the new array, e.g., ``(2, 3)`` or ``2``.\n    dtype : data-type, optional\n        The desired data-type for the array, e.g., `numpy.int8`.  Default is\n        `numpy.float64`.\n    order : {'C', 'F'}, optional\n        Whether to store multidimensional data in C- or Fortran-contiguous\n        (row- or column-wise) order in memory.\n\n    Returns\n    -------\n    out : ndarray\n        Array of zeros with the given shape, dtype, and order.\n\n    See Also\n    --------\n    zeros_like : Return an array of zeros with shape and type of input.\n    ones_like : Return an array of ones with shape and type of input.\n    empty_like : Return an empty array with shape and type of input.\n    ones : Return a new array setting values to one.\n    empty : Return a new uninitialized array.\n\n    Examples\n    --------\n    >>> np.zeros(5)\n    array([ 0.,  0.,  0.,  0.,  0.])\n\n    >>> np.zeros((5,), dtype=numpy.int)\n    array([0, 0, 0, 0, 0])\n\n    >>> np.zeros((2, 1))\n    array([[ 0.],\n           [ 0.]])\n\n    >>> s = (2,2)\n    >>> np.zeros(s)\n    array([[ 0.,  0.],\n           [ 0.,  0.]])\n\n    >>> np.zeros((2,), dtype=[('x', 'i4'), ('y', 'i4')]) # custom dtype\n    array([(0, 0), (0, 0)],\n          dtype=[('x', '<i4'), ('y', '<i4')])\n\n    ";
static char __pyx_k_110[] = "zeros_like (line 2666)";
static char __pyx_k_111[] = "Return an array of zeros with the same shape and type as a given array.\n\n    Equivalent to ``a.copy().fill(0)``.\n\n    Parameters\n    ----------\n    a : array_like\n        The shape and data-type of `a` define the parameters of\n        the returned array.\n\n    Returns\n    -------\n    out : ndarray\n        Array of zeros with same shape and type as `a`.\n\n    See Also\n    --------\n    ones_like : Return an array of ones with shape and type of input.\n    empty_like : Return an empty array with shape and type of input.\n    zeros : Return a new array setting values to zero.\n    ones : Return a new array setting values to one.\n    empty : Return a new uninitialized array.\n\n    Examples\n    --------\n    >>> x = np.arange(6)\n    >>> x = x.reshape((2, 3))\n    >>> x\n    array([[0, 1, 2],\n           [3, 4, 5]])\n    >>> np.zeros_like(x)\n    array([[0, 0, 0],\n           [0, 0, 0]])\n\n    >>> y = np.arange(3, dtype=np.float)\n    >>> y\n    array([ 0.,  1.,  2.])\n    >>> np.zeros_like(y)\n    array([ 0.,  0.,  0.])\n\n    ";
